import React from 'react';

const ReservarTaller = () => {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gray-50 p-4">
      {/* Contenedor principal - Cuadrado con borde */}
      <div className="w-full max-w-md border-2 border-green-600 bg-white rounded-lg shadow-md p-8">
        
        {/* Título */}
        <h1 className="text-3xl font-bold text-center mb-6 text-green-700">
          RESERVAR TALLER
        </h1>

        {/* Sección del taller */}
        <div className="space-y-4 mb-8">
          <h2 className="text-xl font-semibold text-gray-800">NOMBRE DEL TALLER</h2>
          <p className="text-gray-600">Descripción del taller...</p>
        </div>

        {/* Botón de reserva */}
        <button className="w-full bg-green-600 hover:bg-green-700 text-white font-bold py-3 px-4 rounded-md transition duration-200">
          RESERVAR TALLER
        </button>
      </div>
    </div>
  );
};

export default ReservarTaller;
